import { useState, useEffect } from "react";

function ClassroomReport(){
    const [data, setData] = useState(null);

    useEffect(() => {
        fetch("http://localhost:8000/classrooms")
        .then(r => r.json())
        .then(d => setData(d));
    }, []);

    if (data){
        return (
            <>
            {data &&
                data.map((item) => {
                return <p key={item.id}>{item.group_id}</p>;
                })}
            </>
        )
    }
    return <h1> Wait for a moment</h1>
    
}


  export default ClassroomReport
